import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';

let width = 1;

function applyThicker (e, w){
  console.log(e, w);
}

ReactDOM.render(
  <React.StrictMode>
    <App border={width} onThicker={applyThicker} />
  </React.StrictMode>,
  document.getElementById('root')
);
